  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Mammography Facility Database is
  updated periodically based on information received from the four FDA-approved accreditation
  bodies: the American College of Radiology (ACR), and the States of Arkansas, Iowa,
  and Texas. Information received by FDA or Certifying State from accreditation bodies
  does not specify if the facility is mobile or stationary. In many instances, but
  not all, the accreditation body notes Mobile following the name of the facility.
  The certification status of facilities may change, so FDA suggests that you check
  the facility's current status and look for the MQSA certificate.</p>n\",\n\t\"license_title\":
